var gui = require('nw.gui');
var win = gui.Window.get();
var aboutStatus = true;

$(document).ready(function() {
    var aboutEasterEgg = [
        "data:image/png;base64,",
        "data:image/png;base64,",
        "data:image/png;base64,",
        "data:image/png;base64,",
        "data:image/png;base64,",
        "data:image/png;base64,"
    ];
    
    $(document).ready(function() {
        $("body").on("dblclick", function() {
            if (aboutStatus) {
                $("#lovely_adolfans").attr('src', aboutEasterEgg[Math.round(Math.random() * 5)]);
                $("#info").css("-webkit-transform", "rotateY(90deg)");
                setTimeout(function() {
                    $("#adolfans").css("-webkit-transform", "rotateY(0deg)");
                }, 100);
                aboutStatus = false;
            } else {
                $("#adolfans").css("-webkit-transform", "rotateY(90deg)");
                setTimeout(function() {
                    $("#info").css("-webkit-transform", "rotateY(0deg)");
                }, 100);
                aboutStatus = true;
            }
        });
        
        $("#close_icon").on("click",function(){
            win.close();
            console.log("yay");
        });
    });
});